import React, {Component} from 'react'
import styles from './Layout.module.css'

console.log(styles)

class Layout extends Component {
  render() {
    return (
      <div className={styles.Layout}>
        <main>
          { this.props.children }
        </main>
      </div>
    )
  }
}

export default Layout
